require 'rails_helper'
describe 'an api can', type: :api do
  before(:each) do
    ENV['kairos_gallery'] = 'test'
    @user = create(:user)
    @user.enrollments.new(image: @test_image)
    @app = create(:app)
    @user.apps << @app
    @app.authorized_users << @user
  end
  context 'authenticate a user via api' do
    scenario 'GET /api/v1/authenticate' do
      get '/api/v1/authenticate', {
        "app_id" => "#{@app.id}",
        "image" => @test_image
      }
      binding.pry
    end

  end
end

@test_image = 'data:image/jpeg;base64,'
